import React from 'react'

export const ModalLogout = () => {
    return (
        <Modal isOpen={this.state.isModalOpen} toggle={this.toggleModal}>
            <ModalBody>
                <h1>Hello</h1>
            </ModalBody>
        </Modal>
    )
}
